import React, { useEffect, useState } from 'react';

const Home = () => {
  const [artists, setArtists] = useState([]);
  const [songs, setSongs] = useState([]);

  useEffect(() => {
    const fetchArtists = async () => {
      try {
        const response = await fetch('/data/artists.json'); // Adjust the path accordingly
        const data = await response.json();
        setArtists(data);
      } catch (error) {
        console.error('Error fetching artists:', error);
      }
    };

    const fetchSongs = async () => {
      try {
        const response = await fetch('/data/songs.json'); // Adjust the path accordingly
        const data = await response.json();
        setSongs(data);
      } catch (error) {
        console.error('Error fetching songs:', error);
      }
    };

    fetchArtists();
    fetchSongs();
  }, []);

  return (
    <div style={{ display: 'flex' }}>
      <div style={{ flex: 1 }}>
        <h2>Artists</h2>
        <ul>
          {artists.map((artist, index) => (
            <li key={index}>
              <img src={artist.Image} alt={artist.Name} />
              <div>
                <h3>{artist.Name}</h3>
                <p>Born: {artist.Born}</p>
                <p>Hometown: {artist.Hometown}</p>
                {/* Add more artist details here if needed */}
              </div>
            </li>
          ))}
        </ul>
      </div>
      <div style={{ flex: 1 }}>
        <h2>Songs</h2>
        <ul>
          {songs.map((song, index) => (
            <li key={index}>
              <img src={song.Image} alt={song.Name} />
              <div>
                <h3>{song.Name}</h3>
                <p>Duration: {song.Duration}</p>
                <p>Plays: {song.Plays}</p>
                <p>Album: {song.Album}</p>
                {/* Add more song details here if needed */}
              </div>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Home;
